import './App.css';
import React, { Component } from 'react'
import Navbar from './Navbar';
import NewsItem from './NewsItem';

export default class App extends Component {
  render() {
    return (
    <div>
      <Navbar />
      <div class="news">
      <div class="container my-3 mx-3"> <NewsItem/></div>
     <div class="container my-3 mx-3">  <NewsItem/></div>
     <div class="container my-3 mx-3">  <NewsItem/></div>
     </div>
   </div>
    )

  }

}
